import request from '@/utils/request'

const baseUrl = `/log/warehouse/goods`

export default {
    pageFind(page, limit, goodsQueryVo) {
        return request({
            path: `${baseUrl}/pageFind/${page}/${limit}`,
            method: 'post',
            data: goodsQueryVo
        })
    }
}
